import React from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import Stack from 'react-bootstrap/Stack';
import Form from 'react-bootstrap/Form';
import "bootstrap/dist/css/bootstrap.min.css";
import { useNavigate } from "react-router-dom"

function Main() {
  const history = useNavigate()
  return (
    <div>
        <header>
      <Navbar expand="lg" className="bg-body-tertiary" data-bs-theme="dark">
      <Container>
      <Navbar.Brand href="/home" onSelect={history('/home')}>Johns' List</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="/" onSelect={history('/')}>Login</Nav.Link>
            <Nav.Link href="/about" onSelect={history('/about')}>About</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
      </header>
      <main>
      <Container>
      <Row className='px-4 my-5'>
        <Col sm={4}>
          <Stack gap={3}>
            <Button variant="dark" href='/CreateListing' onSelect={history('/CreateListing')}>Create a Listing</Button>
            <Button variant="dark" href='/MyListing' onSelect={history('/MyListing')}>My Profile</Button>
            <Form.Control className="p-2" placeholder="Search johnslist" />
              <Button variant="secondary">Submit</Button>
          </Stack>
        </Col>
        <Col sm={8} className='px-3 my-6'>
          <h2 className="text-center">Categories</h2>
          <Row xs="auto" md={3} >
            <Col>
              <Card style={{ width: '14rem' }}>
              <Card.Img variant="top" src="data:image/jpeg;base64," />
              <Card.Body>
              <Card.Title>Cars</Card.Title>
              <Card.Text>
                Find your next vehicle
              </Card.Text>
                <Button variant="success" href="/cars" onSelect={history('/cars')}>Explore</Button>
              </Card.Body>
              </Card>
            </Col>
            <Col>
              <Card style={{ width: '14rem' }}>
              <Card.Img variant="top" src="https://cdn.brookfieldresidential.net/-/media/brp/texas/austin-area/austin/easton-park/traditional-homes/discovery-park/occidental/occidental-farmhouse-a-5011-aus-jpeg-1600-x-1000.jpg?rev=6711692234a4481490331bd9e0d2d515" />
              <Card.Body>
              <Card.Title>Housing</Card.Title>
              <Card.Text>
                Find your next home
              </Card.Text>
                <Button variant="success" href="/housing" onSelect={history('/housing')}>Explore</Button>
              </Card.Body>
              </Card>
            </Col>
            <Col>
              <Card style={{ width: '14rem' }}>
              <Card.Img variant="top" src="https://d2gg9evh47fn9z.cloudfront.net/1600px_COLOURBOX51974825.jpg" />
              <Card.Body>
              <Card.Title>Jobs</Card.Title>
              <Card.Text>
                Employers are hiring
              </Card.Text>
                <Button variant="success" href="/jobs" onSelect={history('/jobs')}>Explore</Button>
              </Card.Body>
              </Card>
            </Col>
          </Row>
          <hr/>
          <Row xs='auto' md={3}>
          <Col>
              <Card style={{ width: '14rem' }}>
              <Card.Img variant="top" src="data:image/jpeg;base64," />
              <Card.Body>
              <Card.Title>Services</Card.Title>
              <Card.Text>
                Need some work done?
              </Card.Text>
                <Button variant="success" href="/services" onSelect={history('/services')}>Explore</Button>
              </Card.Body>
              </Card>
            </Col>
            <Col>
              <Card style={{ width: '14rem' }}>
              <Card.Img variant="top" src="https://st.depositphotos.com/21037620/56725/i/1600/depositphotos_567256270-stock-photo-street-sign-direction-way-sold.jpg" />
              <Card.Body>
              <Card.Title>For Sale</Card.Title>
              <Card.Text>
                Find great items
              </Card.Text>
                <Button variant="success" href="/forsale" onSelect={history('/forsale')}>Explore</Button>
              </Card.Body>
              </Card>
            </Col>
            <Col>
              <Card style={{ width: '14rem' }}>
              <Card.Img variant="top" src="https://fitorenutrition.com/cdn/shop/articles/anti-inflammatoryfoods_1_1600x.jpg?v=1634574612" />
              <Card.Body>
              <Card.Title>Nutrition</Card.Title>
              <Card.Text>
                Healthy Living!
              </Card.Text>
                <Button variant="success" href="/nutrition" onSelect={history('/nutrition')}>Explore</Button>
              </Card.Body>
              </Card>
            </Col>
          </Row>
        </Col>
      </Row>
    </Container>
      </main>
    </div>
  )
}

export default Main